pragma solidity >=0.5.0 <0.6.0;

import "./chickenfactory.sol";

contract KittyInterface {
    function getKitty(uint256 _id)
        external
        view
        returns (
            bool isGestating,
            bool isReady,
            uint256 cooldownIndex,
            uint256 nextActionAt,
            uint256 siringWithId,
            uint256 birthTime,
            uint256 matronId,
            uint256 sireId,
            uint256 generation,
            uint256 genes
        );
}

contract ChickenFeeding is ChickenFactory {
    KittyInterface kittyContract;

    modifier onlyOwnerOf(uint _chickenId) {
        require(msg.sender == chickenToOwner[_chickenId]);
        _;
    }

    function setKittyContractAddress(address _address) external onlyOwner {
        kittyContract = KittyInterface(_address);
    }

    function _triggerCooldown(Chicken storage _chicken) internal {
        _chicken.readyTime = uint32(now + cooldownTime);
    }

    function _isReady(Chicken storage _chicken) internal view returns (bool) {
        return (_chicken.readyTime <= now);
    }

    function feedAndMultiply(
        uint _chickenId,
        uint _targetDna,
        string memory _species
    ) internal onlyOwnerOf(_chickenId) {
        Chicken storage myChicken = chickens[_chickenId];
        _targetDna = _targetDna % dnaModulus;
        uint newDna = (myChicken.dna + _targetDna) / 2;
        if (
            keccak256(abi.encodePacked(_species)) ==
            keccak256(abi.encodePacked("kitty"))
        ) {
            newDna = newDna - (newDna % 100) + 99;
        }
        _createChicken("NoName", newDna);
        _triggerCooldown(myChicken);
    }

    function feedOnKitty(uint _chickenId, uint _kittyId) public {
        uint kittyDna;
        (, , , , , , , , , kittyDna) = kittyContract.getKitty(_kittyId);
        feedAndMultiply(_chickenId, kittyDna, "kitty");
    }
}
